const paymentMethods = [
  { id: 1, name: "Efectivo", shortName: "EFECT" },
  { id: 2, name: "Visa", shortName: "VISA" },
  { id: 3, name: "Mastercard", shortName: "MC" },
  { id: 4, name: "Yape", shortName: "YAPE" },
  { id: 5, name: "Transferencia", shortName: "TRANSF" }
];

export default paymentMethods;
